import React from 'react';
import ReactDOM from 'react-dom';

const fname = "Saurav";
const lname = "Prasai";
ReactDOM.render(
  <>
    <h1>{`My name is ${fname} ${lname}`}</h1>
    <h1>{`Current Time is : ${Date(2021,2,2)}`}</h1>
  </>
  ,document.getElementById('root')
)
